	//传入类名，把省份添加到该类名下的select
	function addselect(classname){
		var span = '';
		var data = syscode.schoolname1;
		var len = syscode.schoolname1.length;
		for ( i = 0 ; i < len ;i++){
			var temp = "";
			temp = data[i].split(',');
			span += "<option value="+temp[0]+">"+temp[1]+"</option> "
		}
		
		$("."+classname+"").append( span );
	}
	//proval 学校所在的省份 school_sel_id学校下拉框id
	function changeSchoolSelect(proval,school_sel_id){

		var	len = syscode.schoolname2.length;
		var school_obj = school_sel_id
		$("#"+school_obj+"").empty() ;
		var span = '';
		if (proval == "-2") {
			for (var i = 0; i < len; i++) {
				var valueArray = syscode.schoolname2[i].split(",");
				var provincestr = valueArray[0].substring(0, 3);
				if (provincestr != "101") {
					span += "<option value="+valueArray[0]+">"+valueArray[1]+"</option> "
				}
			}
		}else if(proval == "-1"){
			
			span += "<option value='-1'>请选择</option> ";
		}else{
			var proval = proval.substring(0, 5);
			for (var i = 0; i < len; i++) {
				var valueArray = syscode.schoolname2[i].split(",");
				var provincestr = valueArray[0].substring(0, 5);
				if (provincestr == proval) {
					span += "<option value="+valueArray[0]+">"+valueArray[1]+"</option> "
				}
			}

		}
		$("#"+school_obj+"").append( span );
	}

	

